import {useState, useEffect} from 'react'

export default function Account({code}) {
  const accessToken = useAuth(code)
  useEffect(() => {
    if (!accessToken) return
    spotifyApi.setAccessToken(accessToken)
  }, [accessToken])

  return (
    <div>{code}</div>
  )
}
